@Override
public synchronized DocValues normValues(String field) throws IOException {
  ensureOpen();
  DocValues values = normsCache.get(field);
  if (values == null) {
    values = MultiDocValues.getNormDocValues(in, field);
    normsCache.put(field, values);
  }
  return values;
}

